  `offered_player_id` varchar(32) DEFAULT NULL,
  `created_dt` datetime DEFAULT NULL,
  `processed_dt` datetime DEFAULT NULL,
  `schedule_dt` datetime DEFAULT NULL,
  `expired_dt` datetime DEFAULT NULL,
